import React, { Component } from 'react'

class App extends Component {

  render() {
    return (
      <div className="container">
        <div class="jumbotron jumbotron-fluid">
          <div class="container">
            <h1 class="display-4">Brands</h1>
            <p class="lead">T.</p>
          </div>
      </div>
      </div>
    )
  }
}

export default App;
